CREATE TABLE `likes_media` (
  `user_id` int unsigned NOT NULL COMMENT 'Ссылка на пользователя поставившего лайк',
  `media_id` int unsigned NOT NULL COMMENT 'Ссылка на медиа, которому поставили лайк',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`user_id`,`media_id`) COMMENT 'Составной первичный ключ',
  KEY `likes_media_media_id` (`media_id`),
  CONSTRAINT `likes_media_media_id` FOREIGN KEY (`media_id`) REFERENCES `media` (`id`),
  CONSTRAINT `likes_media_user_id` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Лайки к медиа, создание таблицы лайков для медиа';
